import React from "react";


const ItemListContainer = (props) => {
    return(
        <section>
            <h1>{props.greeting}</h1>
            <ul>
                {
                    props.productList.map(item => 
                    <li>{item.id}</li>
                )}
            </ul>
        </section>
    );
}

export default ItemListContainer;
